	type: string;
    onClick?: () => void;
	buttonText: string;
	className: string;
	fullWidth: string;
}

function ButtonComponent({ variant,type,buttonText }: ButtonProps) {
	return <Button variant={variant}
	type={type}
	buttonText={buttonText}


	>{buttonText}</Button>;
}

